				"content": "The field of GIS (S for Systems, Sciences, Services, and Studies) is at a cross-road in the early 2010s. Aiming to link the multiple visions for the next phase of GIS development, this article suggests that the emerging open GIS should serve as a guiding concept. Contextualized in the broader literature of open science, this article proposes open GIS should include eight dimensions related to data, software, hardware, standards, research, publication, funding, and education. For the GIS community, open GIS offers four exciting opportunities: (1) technology-driven opportunities for addressing challenges posed by the (spatial) big data deluge; (2) application-led opportunities for confronting the problems of a rapidly changing planet; (3) curiosity-inspired, crowd-powered opportunities for the development of an open and geographic citizen science; and (4) education-focused opportunities for implementing the vision of a spatial university. Although there are academic, legal, social/political, and environmental impediments for the practice of open GIS, open GIS will become increasingly important in shaping our research and educational agendas in the future.",
