				"content": "Context aware recommender systems (CARS) adapt the rec- ommendations to the specific situation in which the items will be consumed. In this paper we present a novel context- aware recommendation algorithm that extends Matrix Fac- torization. We model the interaction of the contextual fac- tors with item ratings introducing additional model param- eters. The performed experiments show that the proposed solution provides comparable results to the best, state of the art, and more complex approaches. The proposed so- lution has the advantage of smaller computational cost and provides the possibility to represent at different granulari- ties the interaction between context and items. We have exploited the proposed model in two recommendation ap- plications: places of interest and music.",
