				"content": "We discuss the video recommendation system in use at YouTube, the worldâs most popular online video commu- nity. The system recommends personalized sets of videos to users based on their activity on the site. We discuss some of the unique challenges that the system faces and how we address them. In addition, we provide details on the exper- imentation and evaluation framework used to test and tune new algorithms. We also present some of the findings from these experiments.",
